INSERT INTO `settings` VALUES (11,'site.title','Заголовок','WHITE',NULL,'text',2,'Site'),(12,'site.logo','Логотип','settings/September2020/93g0Tx97CdBdq6mmUEpg.png',NULL,'image',3,'Site'),(13,'site.logo2','Логотип 2','settings/September2020/e5tiSViCsnLhgqiLM9gn.png',NULL,'image',6,'Site'),(14,'cocseti.vk','Вконтакте','https://vk.com/',NULL,'text',7,'Cоц.сети'),(15,'cocseti.instagram','Инстаграм','https://vk.com/',NULL,'text',8,'Cоц.сети'),(16,'cocseti.facebook','Facebook','https://vk.com/',NULL,'text',9,'Cоц.сети'),(17,'cocseti.telegram','Telegram','https://vk.com/',NULL,'text',10,'Cоц.сети'),(18,'cocseti.youtube','Youtube','https://youtube/',NULL,'text',11,'Cоц.сети'),(24,'stranicy.about_page','О проекте','<p>&laquo;Академия&nbsp; &nbsp;профессий&raquo;&nbsp; &nbsp;-&nbsp; &nbsp;это&nbsp; &nbsp;проект,&nbsp; &nbsp;ориентированный&nbsp; &nbsp;на повышение уровня образования&nbsp; нового поколения Казахстана. Здесь&nbsp; &nbsp;каждый&nbsp; &nbsp;студент&nbsp; может&nbsp; &nbsp;получить&nbsp; &nbsp;применяемые&nbsp; &nbsp;на практике&nbsp; &nbsp;знания,&nbsp; &nbsp;стажировку&nbsp; &nbsp;и&nbsp; &nbsp;квалификацию&nbsp; &nbsp;в&nbsp; &nbsp;выбранной сфере.</p>',NULL,'rich_text_box',13,'Страницы'),(25,'stranicy.student_page','Для студентов','<p>&laquo;Академия&nbsp; &nbsp;профессий&raquo;&nbsp; &nbsp;-&nbsp; &nbsp;это&nbsp; &nbsp;проект,&nbsp; &nbsp;ориентированный&nbsp; &nbsp;на повышение уровня образования&nbsp; нового поколения Казахстана.</p>',NULL,'rich_text_box',14,'Страницы'),(26,'stranicy.partner_page','Для партнеров','<p>&laquo;Академия&nbsp; &nbsp;профессий&raquo;&nbsp; &nbsp;-&nbsp; &nbsp;это&nbsp; &nbsp;проект,&nbsp; &nbsp;ориентированный&nbsp; &nbsp;на повышение уровня образования&nbsp; нового поколения Казахстана.</p>',NULL,'rich_text_box',15,'Страницы'),(28,'o-nas-banner.about_banner_title','Заголовок','Достигай своих целей вместе с нами!',NULL,'text',17,'О нас баннер'),(30,'o-nas-banner.about_banner_text1','Текст баннер','<p><!--(figmeta)eyJmaWxlS2V5IjoiV3J1UTJxQVFRZjNhQnpXdUNSZlJFVyIsInBhc3RlSUQiOi0xLCJkYXRhVHlwZSI6InNjZW5lIn0K(/figmeta)--><!--(figma)(/figma)--><span style=\"white-space: pre-wrap;\">Наш проект помог более 8000 студентам обучиться различным профессиям, и сейчас они работают и являются хорошими специалистами в своих сферах.</span></p>',NULL,'rich_text_box',19,'О нас баннер'),(31,'o-nas-banner.about_banner_author_name','Имя автор','Садыкова Д. Р.',NULL,'text',20,'О нас баннер'),(32,'o-nas-banner.about_banner_author_company','Автор подзаголовок','Основатель “W.H.I.T.E.”',NULL,'text',21,'О нас баннер'),(33,'o-nas-banner.about_banner_author_foto','Фото автора','settings/September2020/AbYBrSxqIFczxbXGnije.png',NULL,'image',22,'О нас баннер'),(34,'glavnaya-banner.main_banner_title','Заголовок','Уникальное торговое предложение',NULL,'text',23,'Главная баннер'),(35,'glavnaya-banner.main_banner_text','Текст','Одним из основных вызовов нашего времени в образовании является несоответствие технологий обучения запросам экономики и общества.',NULL,'text_area',24,'Главная баннер'),(36,'glavnaya-banner.video','Видео','[{\"download_link\":\"settings\\/September2020\\/UAYq4VGtFzCIUkbi12E7.mp4\",\"original_name\":\"file_example_MP4_480_1_5MG.mp4\"}]',NULL,'file',25,'Главная баннер'),(38,'glavnaya-banner.bg_video','Видео Фон','[{\"download_link\":\"settings\\/September2020\\/e2eUMyLDk2pDdRjHgzIe.png\",\"original_name\":\"preview.png\"}]',NULL,'file',26,'Главная баннер'),(39,'site.favion','Logo','settings/September2020/a3FfYfnpNyFtEUYIa3vO.png',NULL,'image',27,'Site'),(40,'site.count_students','Количество студентов в курсе','72',NULL,'text',28,'Site'),(41,'stranicy-kz.about_page','О проекте','<p>&laquo;Мамандықтар академиясы&raquo; - бұл Қазақстанның жаңа буынының білім деңгейін көтеруге бағытталған жоба. Мұнда әр студент практикада, практикада және таңдалған салада біліктілікте қолданылатын білімді ала алады.</p>',NULL,'rich_text_box',29,'Страницы KZ'),(42,'stranicy-kz.student_page','Для студентов','<p>&laquo;Мамандықтар академиясы&raquo; - бұл Қазақстанның жаңа буынының білім деңгейін көтеруге бағытталған жоба.</p>',NULL,'rich_text_box',30,'Страницы KZ'),(43,'stranicy-kz.partner_page','Для партнеров','<p>&laquo;Мамандықтар академиясы&raquo; - бұл Қазақстанның жаңа буынының білім деңгейін көтеруге бағытталған жоба.</p>',NULL,'rich_text_box',31,'Страницы KZ'),(44,'stranicy-kz.contacts_page','Контакты','<p><span style=\"color: #222222; font-family: Menlo, monospace; font-size: 11px; white-space: pre-wrap;\">Байланыс құралдары</span></p>',NULL,'rich_text_box',32,'Страницы KZ'),(45,'o-nas-banner-kz.about_banner_title','Заголовок','Мақсаттарыңа бізбен бірге жет!',NULL,'text',33,'О нас баннер KZ'),(46,'o-nas-banner-kz.about_banner_text1','Текст баннер','<p><!--(figmeta)eyJmaWxlS2V5IjoiV3J1UTJxQVFRZjNhQnpXdUNSZlJFVyIsInBhc3RlSUQiOi0xLCJkYXRhVHlwZSI6InNjZW5lIn0K(/figmeta)--><!--(figma)(/figma)--><span style=\"white-space: pre-wrap;\">Біздің заманымыздың білім беруіндегі негізгі сын-қатерлерінің бірі оқыту технологияларының экономика мен қоғамның сұраныстарына сәйкес келмеуі болып табылады. </span></p>',NULL,'rich_text_box',34,'О нас баннер KZ'),(47,'o-nas-banner-kz.about_banner_author_name','Имя автор','Садыкова Д. Р.',NULL,'text',35,'О нас баннер KZ'),(48,'o-nas-banner-kz.about_banner_author_company','Автор подзаголовок','Основатель “W.H.I.T.E.”',NULL,'text',36,'О нас баннер KZ'),(49,'glavnaya-banner-kz.main_banner_title','Заголовок','Бірегей сату ұсынысы',NULL,'text',37,'Главная баннер KZ'),(50,'glavnaya-banner-kz.main_banner_text','Текст','Біздің заманымыздың білім беруіндегі негізгі сын-қатерлерінің бірі оқыту технологияларының экономика мен қоғамның сұраныстарына сәйкес келмеуі болып табылады.',NULL,'text_area',38,'Главная баннер KZ'),(51,'site.logo_kz','Логотип kz','settings/September2020/w9g97CKwrIMN6dOCzLic.png',NULL,'image',39,'Site'),(52,'site.logo2_kz','Логотип 2 kz','settings/September2020/XStQh4jiISTC5PE7iFCY.png',NULL,'image',40,'Site'),(53,'site.send_email_student','Почта которая поступает заявка от студента','zbulanbek@gmail.com',NULL,'text',41,'Site'),(54,'site.site.send_email_partner','Почта которая поступает заявка от партнера','zbulanbek@gmail.com',NULL,'text',42,'Site'),(55,'stranicy.partner_page_text','Партнеров текст','<p><strong><span style=\"color: #333333; font-family: Nunito, sans-serif; font-size: 18px;\">Информация о программе стажировки для Наших будущих партнёров: </span></strong></p>\r\n<p><span style=\"color: #333333; font-family: Nunito, sans-serif; font-size: 18px;\">Студенты и выпускники средних профессиональных учебных заведений проходят курсы по выбранному направлению и получают новую профессию в Нашей Академии. </span></p>\r\n<p><span style=\"color: #333333; font-family: Nunito, sans-serif; font-size: 18px;\">После регистрации каждый студент получает доступ на платформу, где начинает обучение. По окончании курса студент проходит итоговую аттестацию и получает сертификат об успешном прохождении курсов. </span></p>\r\n<p><span style=\"color: #333333; font-family: Nunito, sans-serif; font-size: 18px;\">Мы передаём Вам учебную и аттестационную статистику студента. Далее Вы сами решаете принимать данного кандидата на стажировку или нет. </span></p>\r\n<p><span style=\"color: #333333; font-family: Nunito, sans-serif; font-size: 18px;\">В случае положительного решения Вы предоставляете студенту условия испытательного срока и объем работы.</span></p>\r\n<p><strong><span style=\"color: #333333; font-family: Nunito, sans-serif; font-size: 18px;\"> В итоге: </span></strong></p>\r\n<p><span style=\"color: #333333; font-family: Nunito, sans-serif; font-size: 18px;\">Студент получает знания, новую профессию и опыт работы в топовой компании. А Вы получаете квалифицированных сотрудников и вносите свой вклад в формирование конкурентноспособной и образованной молодёжи Казахстана</span></p>',NULL,'rich_text_box',43,'Страницы'),(56,'stranicy-kz.partner_page_text_kz','Партнеров текст','<p><strong>Біздің болашақ серіктестеріміз үшін тағылымдама бағдарламасы туралы ақпарат:</strong></p>\r\n<p>Орта кәсіптік оқу орындарының студенттері мен түлектері таңдалған бағыт бойынша курстардан өтіп, біздің Академияда жаңа мамандық алады.</p>\r\n<p>Тіркеуден кейін әр студент оқуды бастайтын платформаға қол жеткізе алады. Курс аяқталғаннан кейін студент қорытынды аттестаттаудан өтіп, курсты ойдағыдай аяқтағаны туралы сертификат алады.</p>\r\n<p>Біз сізге студенттің оқу және сертификаттау статистикасын ұсынамыз. Содан кейін сіз бұл кандидатты тағылымдамаға қабылдау-алмауды шешесіз.</p>\r\n<p>Оң шешім қабылдаған жағдайда сіз студентке сынақ мерзімі мен жұмыс көлемін ұсынасыз.</p>\r\n<p><strong>Сайып келгенде:</strong></p>\r\n<p>Студент білімді, жаңа кәсіпті және жетекші компанияда жұмыс тәжірибесін алады. Сіз білікті қызметкерлер алып, Қазақстанда бәсекеге қабілетті және білімді жастардың қалыптасуына өз үлесіңізді қосасыз</p>',NULL,'rich_text_box',44,'Страницы KZ'),(57,'site.address','Адрес','г. Алматы, пр. Абая, д.1, 3 этаж',NULL,'text',45,'Site'),(58,'site.phones','Телефоны','<p>+7 (777) 123-45-67</p>\r\n<p>+7 (777) 765-43-21 (Call center)</p>\r\n<p>+7 (777) 723-00-67 (По учебным вопросам)</p>',NULL,'rich_text_box',46,'Site'),(59,'site.email','Email','academy-prof@info.kz',NULL,'text',47,'Site'),(60,'site.phones_kz','Телефоны kz','<p>+7 (777) 123-45-67</p>\r\n<p>+7 (777) 765-43-21 (Call center)</p>\r\n<p>+7 (777) 723-00-67 (Білім беру сұрақтары үшін)</p>',NULL,'rich_text_box',48,'Site'),(61,'site.address_kz','Адрес kz','қ. Алматы, пр. Абая, д.1, 3 этаж',NULL,'text',49,'Site'),(62,'site.map','Карта','<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d1764.6092231927048!2d76.9342877437994!3d43.24245630713528!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x38836ec4e8c0e843%3A0xb63e29fe72863f58!2z0YPQu9C40YbQsCDQkNC80LDQvdCz0LXQu9GM0LTRiyA5Miwg0JDQu9C80LDRgtGLIDA1MDAwMA!5e0!3m2!1sru!2skz!4v1607871257625!5m2!1sru!2skz\" width=\"600\" height=\"300\" frameborder=\"0\" style=\"border:0;\" allowfullscreen=\"\" aria-hidden=\"false\" tabindex=\"0\"></iframe>',NULL,'text_area',50,'Site'),(63,'site.send_email_partner','Почта которая поступает заявка от партнера','zbulanbek@gmail.com',NULL,'text',51,'Site');
