INSERT INTO `speakers` VALUES (1,'Есен','Бисембаев','Менеджер по продажам','speakers/December2020/Tth9dCKo2JwJ1Ri2tGIa.jpg','<p class=\"text\">Спикер курса: <br />&ldquo;Менеджер по продажам&rdquo;</p>\n<ul class=\"text\">\n<li>Эксперт по построению отдела продаж</li>\n<li>5 лет в продажах</li>\n<li>Прособеседовал 1000 кандидатов, обучил 400 продажников</li>\n<li>Заработал для компаний 5 млрд тг</li>\n</ul>\n<p class=\"text\">Построил отделы продаж компаниям: <br />World Class в Москве, Business Expert, Rams, Qubid, New A-forum 2019, Hasta la Visa, Металлсервис Казахстан</p>','2020-11-26 13:12:00','2020-12-22 11:19:15'),(2,'Диана','Кулакеева','SMM','speakers/December2020/H7oORNaaziKB7vLPS9sZ.jpg','<p class=\"text\">Спикер курса: <br />&ldquo;<strong>SMM</strong>&rdquo;</p>\n<ul class=\"text\">\n<li>Эксперт в области маркетинга</li>\n<li>В этой сфере она работает уже 11 лет</li>\n<li>Последние 3 года занималась Digital Marketing</li>\n<li>Заработал для компаний 5 млрд тг</li>\n</ul>\n<p class=\"text\">Является директором маркетингового агентства &laquo;Qamaladdin Media&raquo;(маркетинговое агентство которая на рынке уже более 3-х лет и сотрудничает с 200 блогерами)</p>\n<p class=\"text\">Основополижитель проекта &laquo;Charity wish tree&raquo; (крупно-масштабный благотворительный проект основанный в 2014 году, целью которого является предоставить детям из неблагополучный семей&nbsp; возможности для саморазвития )</p>','2020-11-26 13:24:00','2020-12-22 11:23:48'),(3,'Дана','Садыкова','Нулевой блок',NULL,'<p class=\"text\">Спикер курса: <br />&ldquo;<strong>Нулевой блок</strong>&rdquo;</p>\n<ul class=\"text\">\n<li>Эксперт в сфере прямых продаж, digital marketing-а, ораторского искусства и коммуникаций с людьми</li>\n<li>В 14 лет начала свою карьеру с позиции менеджер по продажам</li>\n<li>В 17 лет вошла в историю как самый молодой директор в сфере образования в Казахстане </li>\n<li>В 18 лет стала Генеральным директором свойственной компании - &laquo;White Development&raquo;</li>\n</ul>','2020-11-26 18:25:12','2020-11-26 18:25:12'),(4,'Александр','Ким','Управление проектами, Интернет-маркетинг и Контент-менеджер','speakers/November2020/hMtizUNxL9RlpjoFoF5Y.png','<p class=\"text\">Спикер курса: <br />&ldquo;<strong>Управление проектами</strong>&rdquo;,&ldquo;<strong>Интернет-маркетинг</strong>&rdquo;,&ldquo;<strong>Контент-менеджер</strong>&rdquo;</p>\n<ul class=\"text\">\n<li>Построил 2 лучшие команды по маркетингу в Казахстане</li>\n<li>Работал 10 лет в маркетинге&nbsp; и из них 7 лет в управлений</li>\n</ul>\n<p class=\"text\">Работал с такими компаниями как: <br />AstanaBank-лидогенерация и управление проектами, TenderFirst (Личный бренд: Нурлан Байдильда)-Управление маркетингом и генерация оборота до 150 млн./мес.+рынок России, New A-Forum 2019-маркетинг и продвижение &ndash; больше 500 участников</p>','2020-11-26 20:06:00','2020-11-26 20:07:15'),(5,'Диана','Тажимова','Маркетолог полного цикла','speakers/November2020/z1jeiVsMTQGAWPSQfyQN.png','<p class=\"text\">Спикер курса: <br />&ldquo;<strong>Менеджер по продажам</strong>&rdquo;</p>\n<ul class=\"text\">\n<li>Детальный специалист по упаковке бизнеса</li>\n<li>Упаковала более 60 сайтов, лендингов и коммерчесих предложений</li>\n<li>Создала 600+ рекламных креативов</li>\n<li>Сгенерила 100 000 лидов</li>\n</ul>\n<p class=\"text\">Упаковала сайты: <br />Tender First, Smart School, WinWin, Альфа-банк</p>','2020-11-26 20:11:10','2020-11-26 20:11:10'),(6,'Данат','Сундугаев','Контент-менеджер','speakers/November2020/AjylZ6IOG17OWwV7C6op.png','<p class=\"text\">Спикер курса: <br />&ldquo;<strong>Контент-менеджер</strong>&rdquo;</p>\n<ul class=\"text\">\n<li>Основатель учебного центра &laquo;ENLAB&raquo;</li>\n<li>Обучил английскому более 640 человек</li>\n<li>Сгенерироваль для компаний более 730 000 000 тенге</li>\n<li>4 года опыты работы в Digital-маркетинге</li>\n</ul>','2020-11-26 20:13:44','2020-11-26 20:13:44'),(7,'Магжан','Тлеуханов','Контент-менеджер','speakers/November2020/JpzAR2Zpw2a3CWHSMRE1.png','<p class=\"text\">Спикер курса: <br />&ldquo;<strong>Контент-менеджер</strong>&rdquo;</p>\n<ul class=\"text\">\n<li>7 лет опыта работы в маркетинге</li>\n<li>Более 1.5 млн долларов реализовано на маркетинговые активности Tender First, AlmaU, Halyk Group, KitoLogistics</li>\n<li>Сооснователь проекта &laquo;Поток&raquo;</li>\n<li>Директор отдела Маркетинга &laquo;Tender First&raquo;</li>\n</ul>','2020-11-26 20:16:30','2020-11-26 20:16:30'),(8,'Тамирис','Кушалиева','Контент-менеджер','speakers/November2020/8Abxf3YekmzKUfky25Yz.png','<p class=\"text\">Спикер курса: <br />&ldquo;<strong>Контент-менеджер</strong>&rdquo;</p>\n<ul class=\"text\">\n<li>Предприниматель &ndash;маркетолог</li>\n<li>Сооснователь маркетингового агентства &laquo;Синтез&raquo;</li>\n<li>Участник проекта &laquo;Stanford GSB 2020&raquo;</li>\n<li>Заработал для компаний 5 млрд тг</li>\n</ul>\n<p class=\"text\">Кейсы:</p>\n<ul class=\"text\">\n<li>Марат Оспанов</li>\n<li>Максим Сарсенов</li>\n<li>CV:\n<ul class=\"text\">\n<li>Резюме рассмотрели в Google Singapore на позицию Business Intern</li>\n<li>Выделили стипендии на обучение в вузах США и Сингапура на сумму свыше $20 000</li>\n</ul>\n</li>\n<li>Ларион Лян\n<ul class=\"text\">\n<li>100 000 подписчиков</li>\n<li>Проовели более 50 выступлений</li>\n<li>Вошел в список 100 новых лиц Казахстана</li>\n<li>Выступил с докладом перед&nbsp; первым президентом РК</li>\n</ul>\n</li>\n<li>Серик Байгиреев\n<ul class=\"text\">\n<li>Выпустили книгу &laquo;Исповедь предпринимателя&raquo; 412 страниц за 3 месяца</li>\n</ul>\n</li>\n<li>Business FM\n<ul class=\"text\">\n<li>Организация October Fest 2019</li>\n<li>Организация Young Enterpreneurs Business Forum </li>\n</ul>\n</li>\n</ul>','2020-11-26 20:19:00','2020-11-30 04:54:31'),(9,'Мейржан','Рыскелді','Основы программирования','speakers/November2020/g6eshH8GTL6NqaTfL2AS.png','<p class=\"text\">Спикер курса: <br />&ldquo;<strong>Основы программирования</strong>&rdquo;</p>\n<ul class=\"text\">\n<li>Более 7 лет работает в сфере программирования</li>\n<li>Генеральный директор компаний &laquo;NIDGE&raquo; (компания по разработке программного обеспечения)</li>\n</ul>','2020-11-26 20:21:39','2020-11-26 20:21:39'),(10,'Назерке','Елубаева','Мобилография','speakers/November2020/QeSkRbRQkEP7HAAmyJ09.png','<p class=\"text\">Спикер курса: <br />&ldquo;<strong>Мобилография</strong>&rdquo;</p>\n<ul class=\"text\">\n<li>Главный проектный менеджер&nbsp; Qamalladin Media</li>\n<li>Специалист по личному бренду/Мобилограф</li>\n<li>Спикер курсов &laquo;Мобилография&raquo;, &laquo;Личный бренд&raquo;, &laquo;SMM&raquo;</li>\n<li>Спродюсировала 200+ видео для соц.сетей</li>\n<li>Обучила 100+ людей мобильной съемке</li>\n<li>Помогла разитию личного бренда блогеров (более 1 000 000 просмотров)</li>\n<li>Управляла 35+ коммерческими проектами разных компаний (МСБ и крупные бренды)</li>\n</ul>','2020-11-26 20:23:00','2020-11-26 20:24:15'),(11,'Таукехан',NULL,'Таргетолог',NULL,'<p class=\"text\">Спикер курса: <br />&ldquo;<strong>Таргетолог</strong>&rdquo;</p>\n<ul class=\"text\">\n<li>Более 3-х лет занимается таргетингом</li>\n</ul>\n<p class=\"text\">Запускал рекламу для таких сфер как: <br />Инфобизнес, Образовательные центры, Медициские центры, Туризм, Общественное питание</p>','2020-11-26 20:26:31','2020-11-26 20:26:31'),(12,'Куат',NULL,'Маркетолог, фрилансер',NULL,'<p class=\"text\">Спикер курса: <br />&ldquo;<strong>Маркетолог</strong>&rdquo;,&ldquo;<strong>Фрилансер</strong>&rdquo;</p>\n<ul class=\"text\">\n<li>Более 3-х лет в маркетинге</li>\n<li>Маркетолог в развивающейся сети клиник &laquo;Banu&raquo;</li>\n</ul>\n<p class=\"text\">Занимался такими проектами как: <br />Бизнес форум с Черняком, Бизнес форум&nbsp; с Маргулан Сейсенбаем, Бизнес форум с Марией Солодар, Более 30+ проектов вел как интернет-маркетолог и использовал все&nbsp; популярные инструменты интернет-маркетинга</p>','2020-11-26 20:29:30','2020-11-26 20:29:30'),(13,'Гаухар',NULL,'Сертифицированный партнер amoCRM',NULL,'<p class=\"text\">Спикер курса: <br />&ldquo;<strong>Менеджер по продажам</strong>&rdquo;</p>\n<ul class=\"text\">\n<li>Сертифицированный партнер amoCRM</li>\n<li>3 года опыт работы с CRM-системами</li>\n<li>Более 20 реализованных проектов</li>\n</ul>','2020-11-26 20:31:48','2020-11-26 20:31:48'),(14,'Искандер',NULL,NULL,NULL,'<p class=\"text\">Спикер курса: <br />&ldquo;<strong>Менеджер по продажам</strong>&rdquo;</p>\n<ul class=\"text\">\n<li>Директор по маркетингу компаний &laquo;Tender First&raquo;</li>\n<li>В маркетинге более 7 лет</li>\n<li>Специализируется на создании контента в Инстаграм, контент-менеджмента, базовой аналитики и управление Production-отдела</li>\n</ul>','2020-11-26 20:33:16','2020-11-26 20:33:16'),(15,'Жулдыз','Дуйсебаева','Web-дизайн',NULL,'<p class=\"text\">Спикер курса: <br />&ldquo;<strong>Web-дизайн</strong>&rdquo;</p>\n<ul class=\"text\">\n<li>Главный креативщик, Web-дизайнер, motion дизайнер и разработчик&nbsp; AR-масок в Qamalladin Media</li>\n<li>Работала в сфере дизайна более 5 лет, из них 2 года в&nbsp; Web-дизайне</li>\n<li>Создала более 100 сайтов</li>\n<li>Упаковала брендинг многих компаний</li>\n<li>Разработала более 30 AR-масок</li>\n</ul>\n<p class=\"text\">Кейсы в образовательной сфере: <br />Алматинская школа-лицей для девушек(КТЛ), ННПООЦ &laquo;Бобек&raquo;, Международная школа Galaxy Алматы, Университет международного бизнеса &laquo;Almau&raquo;</p>\n<p class=\"text\">Кейсы в бьюти сфере: <br />Французский дом, Beautimania</p>\n<p class=\"text\">Кейсы в ресторанном бизнесе:<br />Bigchef&rsquo;s, 6&rdquo;INCH, У Афанасича</p>','2020-11-26 20:37:18','2020-11-26 20:37:18'),(16,'Анвар','Бусаков','Web-дизайн','speakers/December2020/D96fCTJR8ruHEG0o3pez.jpg','<p class=\"text\">Спикер курса: <br />&ldquo;<strong>Web-дизайн</strong>&rdquo;</p>\n<ul class=\"text\">\n<li>Web-дизайнер и ментор в Qamalladin Media</li>\n<li>Более 3,5 года в Web-дизайне</li>\n<li>Создал более 150 сайтов за все время работы</li>\n<li>Упаковал более 50 проектов в образовательной сфере</li>\n</ul>\n<p class=\"text\">Кейсы: <br />Web-дизайны в компании China Pro; Web-дизайны образовательных курсов; Web-дизайны для Fashion Индустрии, главного фотограф Merzedes-Benz Fashion Week а и главного makeup стилиста Merzedes-Benz Fashion Week; Web-дизайн для известного 3D анимационщика,&nbsp; который работал с такими компаниями как GUCCI и AUDI;</p>','2020-11-26 20:39:00','2020-12-22 11:18:48');
